import React from 'react';
/* eslint-disable */
class JsonTable extends React.Component {

    constructor(props) {
        super(props);
    }
    render() {
        return (
             <table>
             <tbody>{this.props.data.request_data.map(function(item, key) {

                      return (
                         <tr key = {key}>
                             <td>{item.userId}</td>
                             <td>{item.id}</td>
                             <td>{item.title}</td>
                             <td>{item.body}</td>
                         </tr>
                       )

                    })}</tbody>
              </table>
        )
    }
};

export default JsonTable;
